import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { ProductListComponent } from './ProductsModule/Infrastracture/Components/product-list-component/product-list.component';
import { ProductsRepository } from './ProductsModule/Infrastracture/Persistence/Repositories/products-repository';
import { IProductsRepository } from './ProductsModule/Core/Domain/Repositories/IProductsRepository';
import { INumberEqualService } from './NumberEqualModule/Core/INumberEqualService';
import { NumberBeetween3And5 } from "./ProductsModule/Core/Services/NumberBeetween3And5";
import { NumberIsOdd } from "./ProductsModule/Core/Services.Abstractions/NumberIsOdd";
import { NumberIsEven } from "./ProductsModule/Core/Services.Abstractions/NumberIsEven";
import { INumberBeetween3And5 } from "./NumberEqualModule/Core/Services.Abstractions/INumberBeetween3And5";
import { INumberIsOdd } from "./ProductsModule/Core/Services.Abstractions/INumberIsOdd";
import { INumberIsEven } from "./ProductsModule/Core/Services.Abstractions/INumberIsEven";
import { ICounter } from './ProductsModule/Core/Services.Abstractions/ICounter';
import { NumberCounterService } from './ProductsModule/Core/Services/number-counter.service';
import { NumberEqualService } from './NumberEqualModule/Core/Services/number-equal.service';
import { IDistinctArrayService } from './ProductsModule/Core/Services.Abstractions/IDistinctService';
import { DistinctArrayService } from './ProductsModule/Core/Services/distinct-array.service';


@NgModule({
  declarations: [
    AppComponent,
    ProductListComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule
  ],
  providers: 
  [
    {provide: IProductsRepository, useClass: ProductsRepository },
    {provide: ICounter, useClass: NumberCounterService },
    {provide: INumberEqualService, useClass: NumberEqualService },
    {provide: IDistinctArrayService, useClass: DistinctArrayService },
    
    {provide: INumberIsEven, useClass: NumberIsEven },
    {provide: INumberIsOdd, useClass: NumberIsOdd },
    {provide: INumberBeetween3And5, useClass: NumberBeetween3And5 }
  ],
  bootstrap: [AppComponent]
})
export class AppModule { }
